import React from 'react';

function PrivacyPolicy() {
    return (
        <div>
            <h1>Privacy Policy</h1>
            <p>
                {/* Add your privacy policy content here */}
                This is our privacy policy.
            </p>
        </div>
    );
}

export default PrivacyPolicy;
